INSERT INTO `picker_S11SeYT2W_posts` VALUES (1,23,'publish','','孩子，把你的手给我','','',NULL,1,1510231493945,1523201495192,0,0,'page','',0,'[105, 103, 101, 99, 97, 15, 13, 11, 9, 7, 5, 3]','海姆·G·吉诺特，心理学博士、临床心理家、儿童心理学家、儿科医生；纽约大学研究生院兼职心理教授、艾德尔菲大学博士后指导教授。 吉诺特博士的一生并不长，他将其短短的一生致力于儿童心理的研究以及对父母和教师的教育。他依靠他的职明才智做了很多创造性的工作，取得了巨大的成就。他在他的书中、演讲中、专栏中宣传的如何跟孩子沟通的创新思想不仅在美国，甚至在全世界都获得巨大反响。',11),(2,23,'publish','','cover2','FhuAJ6OQjXRZK9DP_UaQL87Ny6hH','https://media.alearning.com.cn/upload_44e37e7b8e3e96b0237b9dbd1d5c9bea.jpg',NULL,1,0,0,0,0,'attachment','image/jpeg',0,NULL,NULL,0),(3,23,'approved','','001作者介绍、朗读者介绍','','',NULL,1,1510230998234,1510230998234,0,0,'post_format','',1,'[4]',NULL,1),(4,23,'publish','','001作者介绍、朗读者介绍','FkivHGkxgGj0EaUyG9otIXt0Rvbv','https://media.alearning.com.cn/upload_6138c43376e3d29403170771057b0620.mp3',NULL,1,0,1522391290407,0,0,'attachment','audio/mp3',0,NULL,NULL,0),(5,23,'approved','','002交流密码：我说的你听懂了吗？（3--6岁）','','',NULL,1,1510233385192,1510233385192,0,0,'post_format','',1,'[49]',NULL,2),(6,23,'publish','','202','liaDVUJUy-ydfirHXcVuPvxcI2ax','https://media.alearning.com.cn/upload_747a214f44bdf0df2ad2e300ba62c269.mp3',NULL,1,0,0,0,0,'attachment','audio/mp3',0,NULL,NULL,0),(7,23,'approved','','003交流密码：我说的你听懂了吗？（7--12岁）','','',NULL,1,1513694056349,1513694056349,0,0,'post_format','',1,'[50]',NULL,3),(8,23,'publish','','203','loC_upGwmZH1TIUOpNkuQX53GVDm','https://media.alearning.com.cn/upload_adc2e73feebc6181ee8d7ea50b28e7c2.mp3',NULL,1,0,0,0,0,'attachment','audio/mp3',0,NULL,NULL,0),(9,23,'approved','','003交流密码：我说的你听懂了吗？（7--12岁）','','',NULL,1,1513694057678,1513694057678,0,0,'post_format','',1,'[51]',NULL,3),(10,23,'publish','','204','lhB5fRrzTD7V-X-huafXDrV-V4i_','https://media.alearning.com.cn/upload_6abc693f92d8d06febd16ec11556c06b.mp3',NULL,1,0,0,0,0,'attachment','audio/mp3',0,NULL,NULL,0),(11,23,'approved','','005无效沟通，有效沟通','','',NULL,1,1513694062899,1513694062899,0,0,'post_format','',1,'[52]',NULL,4),(12,23,'publish','','205','lpoTX1bqa2IcGZwOkYaXZV44D