f_vE080wMvJBJRFXSDsDn58y','https://media.alearning.com.cn/upload_61e4702e9e3cbda50164d34a5e191559.jpg',NULL,1,0,0,0,0,'attachment','image/jpeg',0,NULL,NULL,0),(37,25,'auto-draft','','忍不住吼孩子','','',NULL,1,1513763485189,1513763485189,0,0,'page','',0,'[38]','父母的吼叫有时候会成为孩子一生的阴影，很多研究表明，长期对孩子发脾气、吼叫，不仅会造成亲子关系的疏离，也会让孩子在成长过程中形成自我否定的消极心理，严重的还会影响他们与别人建立亲密关系的能力。\n然而，这些道理很多人懂，做到却好难好难。',0),(38,25,'draft','','忍不住吼孩子','','',NULL,1,1510233939528,1510233939528,0,0,'post_format','',37,'[63]',NULL,1),(39,25,'publish','','002忍不住吼孩子','lnn3R7Hi_oHnPO7U1LtNoBkxDSzT','https://media.alearning.com.cn/upload_cb5a40c19b81c90218d632218c75a261.mp3',NULL,1,0,0,0,0,'attachment','audio/mp3',0,NULL,NULL,0),(40,25,'publish','','忍不住吼孩子','FohDsO7VR9oLS_lMxPn6yyXwCPAj','https://media.alearning.com.cn/upload_65e484814b5c464b788fbc44f0d70434.jpg',NULL,1,0,0,0,0,'attachment','image/jpeg',0,NULL,NULL,0),(41,25,'auto-draft','','有话好好说','','',NULL,1,1510232822668,1515211219058,0,0,'post_format','',0,NULL,'语言是带情绪的，你所说的每一个字串联起来，有可能给人带去温暖，但也可能带来伤害。“打击式教育”出来的孩子不能坚持自我，很容易生气，不懂得尊重别人的感受，行为粗鲁没有礼貌……。\n',0),(42,25,'publish','','有话好好说','','',NULL,1,1513763765816,1513763765816,0,0,'page','',0,'[67]','语言是带情绪的，你所说的每一个字串联起来，有可能给人带去温暖，但也可能带来伤害。“打击式教育”出来的孩子不能坚持自我，很容易生气，不懂得尊重别人的感受，行为粗鲁没有礼貌……。',1),(43,25,'publish','','有话好好说','Fo8VDR86Z9u17f6SSvlcOty5zh5G','https://media.alearning.com.cn/upload_a3532aacb6e0409d8e052ce70c81dbdb.jpg',NULL,1,0,0,0,0,'attachment','image/jpeg',0,NULL,NULL,0),(44,24,'publish','','1','luqKYcKpWjLDxjGfgrKjFH7V8Vpv','https://media.alearning.com.cn/upload_e92a245eda628e4fffdc35b99fef5b2f.mp3',NULL,1,0,0,0,0,'attachment','audio/mp3',0,NULL,NULL,0),(45,25,'auto-draft','','这个世界没有笨小孩','','',NULL,1,1513763509063,1513763509063,0,0,'page','',0,'[46]','绝大部分人智商差异不大，只是特长不同而已。有的孩子虽然读书不行，但也许在其他方面有很大的潜力；有的孩子刚开始上小学时成绩不是特别好，但是后劲足，潜力大。\n',0),(46,25,'draft','','这个世界没有笨小孩','','',NULL,1,1510234001495,1510234001495,0,0,'post_format','',45,'[65]',NULL,1),(47,25,'publish','','1','luXsa3Xkwq2BVWFi3mq26QKn8wYp','https://media.alea